import { GET_DIARYS, ADD_DIARY, DELETE_DIARY } from '../actions/types';

const initialState = {
    diaries: [],
};


export default function(state = initialState, action) {
   switch(action.type) {
       case GET_DIARYS:
           return {
               ...state
           }
        default: 
           return state;
   }
}
